class Solution {
  bool isVowel(String c) {
    return "aeiou".contains(c);
  }

  int beautifulSubstrings(String s, int k) {
    int n = s.length;
    int count = 0;

    // Iterate over all possible lengths for substrings with equal number of vowels and consonants
    for (int length = 2; length <= n; length += 2) {
      int vowels = 0, consonants = 0;

      // Initialize the first window
      for (int i = 0; i < length; i++) {
        if (isVowel(s[i])) vowels++;
        else consonants++;
      }

      if (vowels == consonants && (vowels * consonants) % k == 0) count++;

      // Slide the window across the string
      for (int i = length; i < n; i++) {
        if (isVowel(s[i - length])) vowels--;
        else consonants--;

        if (isVowel(s[i])) vowels++;
        else consonants++;

        if (vowels == consonants && (vowels * consonants) % k == 0) count++;
      }
    }

    return count;
  }
}
